# Create tableau and circuit
tableau = stim.Tableau.from_stabilizers(pauli_strings, allow_underconstrained=True, allow_redundant=True)
circuit = tableau.to_circuit(method='elimination')

print(f'Original circuit has {len(circuit)} operations')

# Check which qubits are used
